// Modal component
import { Modal } from './Modal/Modal';

const Item = (props) =>{
    return(
        <>
            <div 
            className='sectionStacks__item' 
            onClick={() => props.setModal(props.index)}>
                <img className='sectionStacks__img' src={props.item.imgIco} alt="img stack"/>
            </div>
        </>
    );
}

export {Item};
